import "./Total.css";
import { DataGrid } from "@material-ui/data-grid";
import { productRows } from "../../dummyData";
import { useState } from "react";

export default function ProductList() {
  const [data] = useState(productRows);


  const columns = [
    { field: "id", headerName: "ID", width: 90 },
    {
      field: "Nama Perangkat",
      headerName: "Nama Perangkat",
      width: 200,
    },
    { field: "Jenisk", 
      headerName: "Jenis", 
      width: 200 
    },
    {
      field: "Jumlah",
      headerName: "Jumlah",
      width: 120,
    },
    {
      field: "Keterangan/Lokasi",
      headerName: "Keterangan/Lokasi",
      width: 200,
    },
  ];

  return (
    <div className="productList">
      <DataGrid
        rows={data}
        disableSelectionOnClick
        columns={columns}
        pageSize={8}
      />
    </div>
  );
}
